import React from 'react';
import './App.css';
import CurrencyCard from './CurrencyCard';

function App() {
  return (
    <div className="App">
      <header className="App-header">
      <CurrencyCard title="Gemini" type="BTC"></CurrencyCard>
      </header>
    </div>
  );
}

export default App;
